import React from 'react';
import styled from 'styled-components';

const Projects = () => {
  return (
    <ProjectsSection id="projects">
      <h2>Highlighted Projects</h2>
      <HighlightedProjects>
        <Project>
          <ProjectTitle>Project 1</ProjectTitle>
          <ProjectDescription>
            Description of project 1. This project highlights my work in VR.
          </ProjectDescription>
        </Project>
        <Project>
          <ProjectTitle>Project 2</ProjectTitle>
          <ProjectDescription>
            Description of project 2. This project showcases my transition to Fintech.
          </ProjectDescription>
        </Project>
        <Project>
          <ProjectTitle>Project 3</ProjectTitle>
          <ProjectDescription>
            Description of project 3. This project is a combination of VR and Fintech.
          </ProjectDescription>
        </Project>
      </HighlightedProjects>
      <h2>Noteworthy Projects</h2>
      <NoteworthyProjects>
        <SmallProject>Noteworthy Project 1</SmallProject>
        <SmallProject>Noteworthy Project 2</SmallProject>
        <SmallProject>Noteworthy Project 3</SmallProject>
        <SmallProject>Noteworthy Project 4</SmallProject>
        <SmallProject>Noteworthy Project 5</SmallProject>
      </NoteworthyProjects>
    </ProjectsSection>
  );
};

const ProjectsSection = styled.section`
  padding: 2rem;
  background: none;
  text-align: center;
`;

const HighlightedProjects = styled.div`
  margin: 0 auto;
  width: 70%;
  display: flex;
  flex-direction: column;
  align-items: center;
`;

const Project = styled.div`
  margin: 1rem 0;
  padding: 2rem;
  text-align: left;
  border-left: 4px solid #e94560;
  box-shadow: 0 4px 8px rgba(0, 0, 0, 0.1);
  width: 100%;
`;

const ProjectTitle = styled.h3`
  margin-bottom: 1rem;
`;

const ProjectDescription = styled.p`
  color: #ccc;
`;

const NoteworthyProjects = styled.div`
  margin: 0 auto;
  width: 70%;
  display: flex;
  flex-wrap: wrap;
  justify-content: space-between;
`;

const SmallProject = styled.div`
  background: #222831;
  margin: 0.5rem;
  padding: 1rem;
  width: 30%;
  box-shadow: 0 4px 8px rgba(0, 0, 0, 0.1);
  border-radius: 8px;
`;

export default Projects;
